import styled from "@emotion/styled";

export const SimpleTable = styled.table`
  th {
    color: #ffffff;
    font-weight: 600;
    font-size: 14px;
  }
  td {
    color: #ffffff;
    font-size: 16px;
    line-height: 20px;
  }
  th,
  td {
    text-align: center;
  }
  width: 100%;
`;
